import './App.css';
import { BrowserRouter, Route, Routes, Router } from 'react-router-dom';
import Home from './components/Home.js'
import Seller from './components/Seller.js'
import Buyer from './components/Buyer.js'
import Commodity from './components/Commodity.js'
import About from './components/About.js'

import Navbar from './components/Navbar.js'
//import 

function App(){
  return (
    <div>
      <Router >
        <Navbar />
        <Routes>
        <Route exact path='/' element={ <Home /> } />
        <Route exact path='/buyer' element={ <Buyer/> } />
        <Route exact path='/sellers' element={ <Seller /> } />
        <Route exact path='/commodity' element={ <Commodity/> } />
        <Route exact path='/about' element={ <About /> } />

        </Routes>
      </Router>

        </div>

  )
}

export default App;
